import React, { Component } from "react";
import Logo from "./logo.png"
import { NavLink } from "react-router-dom";

export default class HeaderAcc extends Component {
    render() {
        return (
            <header>
                <img src={Logo} alt="TSU Logo" />
                <input type="search" placeholder="Search" />
                <NavLink to=''><span class="material-symbols-outlined">notifications</span></NavLink>
                <NavLink to=''><span class="material-symbols-outlined">account_circle</span></NavLink>
                <NavLink to=''><span class="material-symbols-outlined">notifications</span></NavLink>
            </header>
        )
    }
}
